package org.unibl.etf.search;

import com.fasterxml.jackson.databind.ObjectMapper;

import dev.ai4j.openai4j.OpenAiClient;

import org.apache.hc.client5.http.classic.methods.HttpPost;
import org.apache.hc.client5.http.impl.classic.CloseableHttpClient;
import org.apache.hc.client5.http.impl.classic.CloseableHttpResponse;
import org.apache.hc.client5.http.impl.classic.HttpClients;
import org.apache.hc.core5.http.ContentType;
import org.apache.hc.core5.http.io.entity.StringEntity;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Component;

import java.io.File;
import java.io.IOException;
import java.nio.file.Files;
import java.util.Base64;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

@Component
public class SearchProductEngine {
    private OpenAiClient openAiClient;
    private String Api_key;

    @Autowired
    public SearchProductEngine() {
        this.Api_key = System.getenv("API_KEY");
    }

    public String search(ChatDto query) throws IOException {
        // 1. Učitaj sliku i enkodiraj u Base64
        //
        String systemPrompt =
                "You are a product engine assistant. You will be receiving prompts in Bosnian,"
                    + " Serbian and Croatian\n"
                    + "Based on the user's query, provide SCALE FROM 1 TO 10 if the receipt has"
                    + " healthy and low carbon footprint items. Do not provide anything else except"
                    + " the VALUES FROM SCALE.  For example: {'image': 'base64encodedimage}\n"
                    + " this means that the user is requesting a check for healthy food or low"
                    + " carbon footprint items are listed on the receipt base64 image. ";

        String base64Image = query.image;



        // 2. Napravi JSON zahtev
        Map<String, Object> requestBody = new HashMap<>();
        requestBody.put("model", "gpt-4-turbo");

        Map<String, String> systemMessage = new HashMap<>();
        systemMessage.put("role", "system");
        systemMessage.put("content", systemPrompt);

        Map<String, String> userTextMessage = new HashMap<>();
        userTextMessage.put("type", "text");
        userTextMessage.put(
                "text",
                "Da li na racunu nalazi proizvod koji je zdrav ili ima malu vrijednost carbon"
                        + " footprinta?");

        Map<String, Object> imageUrlMap = new HashMap<>();
        imageUrlMap.put("url", "data:image/png;base64," + base64Image);

        Map<String, Object> userImageMessage = new HashMap<>();
        userImageMessage.put("type", "image_url");
        userImageMessage.put("image_url", imageUrlMap);

        Map<String, Object> userMessage = new HashMap<>();
        userMessage.put("role", "user");
        userMessage.put("content", new Object[] {userTextMessage, userImageMessage});

        requestBody.put("messages", new Object[] {systemMessage, userMessage});

        // 3. Pošalji zahtev ka API-ju
        String response =
                sendPostRequest("https://api.openai.com/v1/chat/completions", requestBody);
        return response;
    }

    public String searchTrashBin(ChatDto query) throws IOException {
        // 1. Učitaj sliku i enkodiraj u Base64
        //
        String systemPrompt =
                "You are a trash bin founder assistant. You will be receiving prompts in Bosnian,"
                    + " Serbian and Croatian\n"
                    + "Based on the user's query, provide ONLY THE LOGIC VALUE if the picture shows"
                    + " a person throwing trash into a trash can Do not provide anything else"
                    + " except the TRUE or FALSE.  For example: {'image': 'base64encodedimage' }\n";

        String base64Image = query.image;

        // String base64Image =
        //
        // "data:image/jpeg;base64,";

        // 2. Napravi JSON zahtev
        Map<String, Object> requestBody = new HashMap<>();
        requestBody.put("model", "gpt-4-turbo");

        Map<String, String> systemMessage = new HashMap<>();
        systemMessage.put("role", "system");
        systemMessage.put("content", systemPrompt);

        Map<String, String> userTextMessage = new HashMap<>();
        userTextMessage.put("type", "text");
        userTextMessage.put("text", "Da li na slici nalazi primjer bacanja smeca u kantu za smece");

        Map<String, Object> imageUrlMap = new HashMap<>();
        imageUrlMap.put("url", "data:image/png;base64," + base64Image);

        Map<String, Object> userImageMessage = new HashMap<>();
        userImageMessage.put("type", "image_url");
        userImageMessage.put("image_url", imageUrlMap);

        Map<String, Object> userMessage = new HashMap<>();
        userMessage.put("role", "user");
        userMessage.put("content", new Object[] {userTextMessage, userImageMessage});

        requestBody.put("messages", new Object[] {systemMessage, userMessage});

        // 3. Pošalji zahtev ka API-ju
        String response =
                sendPostRequest("https://api.openai.com/v1/chat/completions", requestBody);
        return response.contains("TRUE") ? "True" : "False";
    }

    private String encodeImageToBase64(File file) throws IOException {
        byte[] fileContent = Files.readAllBytes(file.toPath());
        return Base64.getEncoder().encodeToString(fileContent);
    }

    private String sendPostRequest(String url, Map<String, Object> requestBody) throws IOException {
        ObjectMapper objectMapper = new ObjectMapper();
        String jsonPayload = objectMapper.writeValueAsString(requestBody);

        try (CloseableHttpClient httpClient = HttpClients.createDefault()) {
            HttpPost postRequest = new HttpPost(url);
            postRequest.setHeader("Authorization", "Bearer " + Api_key);
            postRequest.setHeader("Content-Type", "application/json");
            postRequest.setEntity(new StringEntity(jsonPayload, ContentType.APPLICATION_JSON));

            try (CloseableHttpResponse response = httpClient.execute(postRequest)) {
                // Parsiranje JSON odgovora
                Map<String, Object> responseMap =
                        objectMapper.readValue(response.getEntity().getContent(), Map.class);
                List<Map<String, Object>> choices =
                        (List<Map<String, Object>>) responseMap.get("choices");

                if (choices != null && !choices.isEmpty()) {
                    Map<String, Object> message =
                            (Map<String, Object>) choices.get(0).get("message");
                    return (String) message.get("content"); // Vraća samo vrednost `content`
                }
            }
        }
        return null; // Ako nešto pođe po zlu
    }
}
